import React, { Component } from "react";

class MyComponent extends Component {
  constructor(props) {
    super(props);

    this.jeff = {name: "jeff", age: 37};
  }

  render() {
    return (
      <div>
        <h1>{this.props.title}</h1>
        <button onClick={this.props.action}>{this.jeff}</button>
      </div>
    );
  }
}

export default MyComponent;
